import './App.css';
import Tracker from './components/Tracker';       
import 'bootstrap/dist/css/bootstrap.css'
import HeaderComponent from './components/HeaderComponent';       

function App() {
  return (
    <div className="App">
      <HeaderComponent/>
      <header className="App-header">

       <Tracker/>
      </header>
    </div>
  );
}

export default App;
